import React, {Component} from 'react';
import ShopData from './shop.data';

class Shop extends Component{

    constructor(){
        super();

        this.state = {
            collections:ShopData
        }
    }

    render(){

        return (

            <div>
                <h1>Shop page</h1>
            </div>
        );
    }
}

export default Shop;
